import React from 'react';
import logo from './logo.svg';
import './App.css';

function Header() {
    return (
        <header>
            <nav className="navbar navbar-light bg-light">
                <span className="navbar-brand">
                    Minimalist Todo List
                </span>
            </nav>
        </header>);
}

export default App;
